import React, { Component } from 'react';
import './index.css';
import { Carousel } from 'antd';

class SwiperItem extends Component {
  render() {
    return (
      <div className="swiper-wrapper">
         <Carousel autoplay>
              <div>
              <h3>1</h3>
            </div>
            <div>
              <h3>2</h3>
            </div>
            <div>
              <h3>3</h3>
            </div>
            <div>
              <h3>4</h3>
            </div>
         </Carousel>
      </div>
    );
  }
}

export default SwiperItem;
